import React from "react";

class Image extends React.Component {
    render() {
        const {src, alt, className, width, height, ...attrs} = this.props
        if (!src) {
src = `https://via.placeholder.com/${width} * ${height}`
        }
        return (
            <img
                src={src}
                alt={alt}
                className={className}
                width={width}
                height={height}
                {...attrs}
            />
        )
    }
};

Image.defaulProps = {
    src:"https://via.placeholder.com/100*100",
    alt:"image name",
    className: ''
}

export default Image;
